import React from 'react';
import { Form } from 'semantic-ui-react';

email_field = () => {
    <Form.Field>
        <label>אימייל</label>
        <Form.Input
            name='email'
            value={email}
            placeholder='@e-mail'
            onChange={this.handleChange}
        />
    </Form.Field>
}
